import React, {useState} from 'react'
import { render } from "react-dom"
import SEO from "../common/SEO";
import HeaderOne from '../common/header/HeaderOne';
import { Calendar, dateFnsLocalizer } from 'react-big-calendar'
import format from "date-fns/format";
import parse from 'date-fns/parse';
import startOfWeek from 'date-fns/startOfWeek';
import getDay from "date-fns/getDay";
import "react-big-calendar/lib/css/react-big-calendar.css"



const locales = {
    "en-US": require("date-fns/locale/en-US")
}

const localizer = dateFnsLocalizer({
    format,
    parse,
    startOfWeek,
    getDay,
    locales
})

const myEventsList = [
    {
        title: "Düsseldorf",
        allDay: true,
        start: new Date(2023, 3, 1),
        end: new Date(2023, 3, 4),
    },
    {
        title: "Helene Fischer Concert Cologne",
        allDay: true,
        start: new Date(2023, 3, 1),
        end: new Date(2023, 3, 3)
    },
    {
        title: "Beauty Düsseldorf",
        allDay: true,
        start: new Date(2023, 3, 1),
        end: new Date(2023, 3, 3)
    },
    {
        title: "Top Hair Düsseldorf",
        allDay: true,
        start: new Date(2023, 3, 1),
        end: new Date(2023, 3, 3)
    },

]

const allViews = Object.keys(Calendar, )


const SailingSchedule = () => {
    return (
        <>
            <SEO title="About Us" />
            <main className="page-wrapper">
                <HeaderOne btnStyle="btn-small" />
                <div style={{height: 700, margin: "70px"}}>
                    <Calendar 
                        localizer={localizer}
                        events={myEventsList}
                        startAccessor="start"
                        endAccessor="end"
                        step={60}
                        defaultDate={new Date(2023, 3, 1)}
                    />
                </div>
                
            </main>
        </>
    )
}

export default SailingSchedule;
